commits.sourceNew:
@Override
public Object clone() {
  try {
    return super.clone();
  } catch (CloneNotSupportedException e) {
    // CharacterIterator does not allow you to throw CloneNotSupported
    throw new RuntimeException(e);
  }
}

@Override
public CharArrayIterator clone() {
  try {
    return (CharArrayIterator)super.clone();
  } catch (CloneNotSupportedException e) {
    // CharacterIterator does not allow you to throw CloneNotSupported
    throw new RuntimeException(e);
  }
}

